import axios from 'axios';
const usersUrl = 'http://localhost:9001/user';

export const deleteUser = async (id) => {
    return await axios.delete(`${usersUrl}/userdelete/${id}`);
}

export const changeuserStatus = async (id) => {
    return await axios.put(`${usersUrl}/changeStatus/${id}`);
}

export const getUsers = async (sortingparams, searchparams) => {
    return await axios.get(`${usersUrl}/userList${sortingparams}/${searchparams}`);
}
